INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L19.Q1','L19.Q1','PM_E_ERBS_GIGABITETHERNET',8,'pmIfInOctetsLink1Hi','counter','INT64','PEG','The total number of octets received on the link, including framing characters.

