INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L19.Q1','L19.Q1','PM_E_ERBS_EUTRANCELLFDD_FLEX',235,'pmFlexUeCtxtRelAbnormalEnb','counter','INT64','PEG','Stepped at reception of S1 message UE context release command with internal cause codes considered abnormal (Radio connection with UE is lost; Handover failure for the UE; UE pre-emption) when the RBS initiated the release. It can also be stepped at transmission of UE context release request or reset message by the RBS, or when a cell owned by that RBS is disabled (and that leads to internal RBS UE context release).

