INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L19.Q1','L19.Q1','PM_E_ERBS_EUTRANCELLFDD_FLEX',254,'pmFlexPdcpPktTransDl','counter','INT64','ACC','Number of DRB packets (PDCP SDUs) successfully transmitted (RLC acknowledged by UE) in the downlink.

